import React from 'react'

const Projects = () => {
    const projects = [
        {
            title : 'The Fit Club',
            description : 'front end website using react'
        },
        {
            title : 'Gold Price Prediction',
            description : 'website for predicting gold price using ML and Django'
        }
    ]
  return (
    <div></div>
  )
}

export default Projects
